import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class Header extends React.Component{
    render(){
        return(
            <div>
    <header>
        <nav>
            <h5><Link to="/">Inicio</Link></h5>
            <h4><Link to="/about">Acerca de</Link></h4>
            <h4><Link to="/portfolio">Portfolio</Link></h4>
            <h4><Link to="/servicio">Servicios</Link></h4>
            <h4><Link to="/clientes">Clientes</Link></h4>
            <h4><Link to="/footer">Contacto</Link></h4>
        </nav>

        <section class="textos-header">
            <h1> NICOLAS PEREZ</h1>
            <h2> Espacio de Definicion Institucional III </h2>
        </section>

    </header>
            </div>
        )
    }
}

export default Header
